glsl3.vert:
precision highp float;
uniform CCGlobal {
  mat4 cc_matView;
  mat4 cc_matViewInv;
  mat4 cc_matProj;
  mat4 cc_matProjInv;
  mat4 cc_matViewProj;
  mat4 cc_matViewProjInv;
  vec4 cc_cameraPos;
  vec4 cc_time;
  mediump vec4 cc_screenSize;
  mediump vec4 cc_screenScale;
};
uniform CCLocal {
  mat4 cc_matWorld;
  mat4 cc_matWorldIT;
};
in vec3 a_position;
in vec4 a_color;
out vec4 v_color;
#if USE_TEXTURE
in vec2 a_uv0;
out vec2 v_uv0;
#endif
void main () {
  vec4 pos = vec4(a_position, 1);
  #if CC_USE_MODEL
  pos = cc_matViewProj * cc_matWorld * pos;
  #else
  pos = cc_matViewProj * pos;
  #endif
  #if USE_TEXTURE
  v_uv0 = a_uv0;
  #endif
  v_color = a_color;
  gl_Position = pos;
}

glsl3.frag:
precision highp float;
#if USE_ALPHA_TEST
  uniform ALPHA_TEST {
    float alphaThreshold;
  };
#endif
void ALPHA_TEST (in vec4 color) {
  #if USE_ALPHA_TEST
      if (color.a < alphaThreshold) discard;
  #endif
}
void ALPHA_TEST (in float alpha) {
  #if USE_ALPHA_TEST
      if (alpha < alphaThreshold) discard;
  #endif
}
uniform CCGlobal {
  mat4 cc_matView;
  mat4 cc_matViewInv;
  mat4 cc_matProj;
  mat4 cc_matProjInv;
  mat4 cc_matViewProj;
  mat4 cc_matViewProjInv;
  vec4 cc_cameraPos;
  vec4 cc_time;
  mediump vec4 cc_screenSize;
  mediump vec4 cc_screenScale;
};
uniform CCLocal {
  mat4 cc_matWorld;
  mat4 cc_matWorldIT;
};
in vec4 v_color;
#if USE_TEXTURE
in vec2 v_uv0;
uniform sampler2D texture;
#endif
void main () {
  vec4 o = vec4(1, 1, 1, 1);
  #if USE_TEXTURE
  vec4 texture_tmp = texture(texture, v_uv0);
  #if CC_USE_ALPHA_ATLAS_texture
      texture_tmp.a *= texture(texture, v_uv0 + vec2(0, 0.5)).r;
  #endif
  #if INPUT_IS_GAMMA
    o.rgb *= (texture_tmp.rgb * texture_tmp.rgb);
    o.a *= texture_tmp.a;
  #else
    o *= texture_tmp;
  #endif
  #endif
  o *= (v_color * 1.0);
  ALPHA_TEST(o);
  float period = 2.0;
  float periodM = period - 0.1;
  float band = 0.02;
  int bandNo = 5;
  float amp = 3.0;
  float time = cc_time.x;
  time = (time - floor(time / periodM) * periodM);
  float temp = time / period;
  float thres = temp - 0.01;
  if ((v_uv0.x + v_uv0.y)/2.0 > thres
    && (v_uv0.x + v_uv0.y)/2.0 < thres +band){
    o *= vec4(1.5,1.5,1.5,1.0);
  }
  if ((v_uv0.x + v_uv0.y)/2.0 > thres  + 1.0*band
    && (v_uv0.x + v_uv0.y)/2.0 < thres +2.0*band){
    o.rgb = (1.0 - o.rgb)*2.0/3.0 + o.rgb;
  }
  if ((v_uv0.x + v_uv0.y)/2.0 > thres + 2.0*band
    && (v_uv0.x + v_uv0.y)/2.0 < thres +3.0*band){
    o.rgb = (1.0 - o.rgb)*3.0/3.0 + o.rgb;
  }
  if ((v_uv0.x + v_uv0.y)/2.0 > thres + 3.0*band
    && (v_uv0.x + v_uv0.y)/2.0 < thres +4.0*band){
    o.rgb = (1.0 - o.rgb)*2.0/3.0 + o.rgb;
  }
  if ((v_uv0.x + v_uv0.y)/2.0 > thres + 4.0*band
    && (v_uv0.x + v_uv0.y)/2.0 < thres +5.0*band){
    o *= vec4(1.5,1.5,1.5,1.0);
  }
  gl_FragColor = o;
}

